import "./App.css";
import Header from "./components/Header";
import { RouterProvider } from "react-router-dom";
import router from "./router/router";

function App() {
  return (
    <RouterProvider router={router}>
      <div className="app">
        <Header />
      </div>
    </RouterProvider>
  );
}

export default App;
